  return (
    <div className="flex flex-col">
      <div className="flex gap-5">
        <div>
          {" "}
          <input
            type="text"
            value={value}
            onChange={(e) => setInput(e.target.value)}
          />
          <button
            className="py-3 px-8 bg-red-accent-400 rounded-xl"
            onClick={() => setValue(value)}
